function Child() {
    const data = [
        {
            State: "Uttar Pradesh",
            Capital: "Lucknow"
        },
        {
            State: "Gujarat",
            Capital: "Gandhinagar"
        },
        {
            State: "Karnataka",
            Capital: "Bengaluru"
        },
        {
            "State": "Punjab",
            "Capital": "Chandigarh"
        },
        {
            "State": "Maharashtra",
            "Capital": "Mumbai"
        }
    ]
    const listItems = data.map(
        (element) => {
            return (
                <ul type="disc">
                    <li style={{ 
                        fontWeight: 'bold', 
                        color: 'red' }}
                    >
                        {element.State}
                    </li>
                    <li>{element.Capital}</li>
                </ul>
            )
        }
    )
    return (
        <div>
            {listItems}
        </div>
    )
  }

  export default Child
